import axios from 'axios';

export const showBills = (keywordString) =>
    axios
        .get(
            'https://api.legiscan.com/?key=${api_key}&op=search&state=${state}&query=${keyword}',
            {
                params: {
                    key: '421f15e8b661176e9001a7e17a50f37b',
                    op: 'search',
                    state: 'ri',
                    query: keywordString.split().join(','),
                },
            }
        )
        .then(
            ({
                data: {
                    searchresult: { summary, ...rest },
                },
            }) => Object.values(rest)
        )
        .catch(() => []);
